def fix_spaces(text):
    new_text = []
    count = 0
    for char in text:
        if char == ' ':
            count += 1
            if count > 2:
                new_text[-1] = '-'  # replace previous underscore with dash
                count = 1
            else:
                new_text.append('_')
        else:
            count = 0
            new_text.append(char)

    return ''.join(new_text)

# Test cases
